2.description:
Преимущества комнаты:


-изолированная непроходная площадью 15 кв м;


-полностью укомплектована мебелью и техникой (дополнится собственным холодильником и плиткой);

Преимущества дома: 


-в 5 минутах ходьбы остановка "Малино", откуда ходит общественный транспорт до МЦД Зеленоград-Крюково;


- в пешей доступности (около 15 мин) 23 микрорайон Зеленограда, где есть ТЦ, салоны красоты, пункты выдачи, кофейни, фитнес-клубы, облагороженный парк "Зеленый бор" для приятных прогулок;


-в близкой доступности школа и политехнический колледж 50;


-территория дома очень облагорожена, есть собственный мангал, летние качели;


-дом располагается в экологическом месте, рядом много деревьев;


-в темное время суток улицы освещаются фонарями.

Санузел располагается в сарае на территории.

Про условия: оплата первый месяц + залог - стоимость месяца (можно разбить на две части) + комиссия 100%, проживание от 9 месяцев, рассматриваются семейные пары, женщины/девушки без детей и животных

В доме проживает бабушка, очень доброжелательна и гостеприимна.

Комната сдаётся с 1 сентября, рассматриваются некурящие девушки и женщины в возрасте до 50 лет.
-----
Примечание: у собственника могут быть дополнительные пожелания к жильцам - обсудите их в чате или по телефону

