5.description:
Предлагается в аренду комната 14 кв.м. в 5-ти комнатной квартире, в квартире никто не проживает (3 комнаты закрыты - никто не живет!), расположенная в Хорошевском районе САО г.Москва, в 10-ти минутах ходьбы от метро Полежаевская, метро Динамо, Зорге, БКЛ Хорошевская и МЦК Хорошево.
Дом кирпичный, индивидуальный проект, 1954 года постройки;
Комната расположена на третьем этаже 8-этажного дома, расположенного по адресу: ул. Зорге, д. 18к3. 
Комната по запросу меблируется. Вся необходимая бытовая техника и мебель есть в кухне. Все чисто и аккуратно! Рассматриваются женщины. 
Развитая инфраструктура района, все в шаговой доступности:
- школы 141 здание 1 и здание 2 и детские сады, школы искусств и танцев, спортивные секции и многое другое;
- колледжи и ВУЗы (НТИМИ);
- детская и взрослая поликлиники, медицинские центры, лаборатории, стоматология;
- торговые центры, магазины (Перекресток, Добрынинский, Дикси, Пятерочка, ВкусВилл и тд);
- кафе, рестораны, пекарни;
- МФЦ, нотариус, отделения банков, аптеки, фитнес-центры, салоны красоты, химчистки, магазины цветов  и многое другое;
- ПВЗ Wildberries, Яндекс.Маркет, OZON, Сдэк, Boxberry, почта;
- для прогулок есть парк Березовая Роща или парк Ходынское поле и скверы.
Все подробности по телефону! Звоните!

